// font.js

function registerJsPDFRobotoCondensed() {
    if (typeof window.jspdf === 'undefined' || typeof window.jspdf.jsPDF === 'undefined' || typeof window.jspdf.jsPDF.API === 'undefined') {
        console.error("window.jspdf lub window.jspdf.jsPDF.API nie jest zdefiniowane podczas próby rejestracji czcionki!");
        return false;
    }

    const jsPDFAPI = window.jspdf.jsPDF.API;

    // Zmienna zawierająca zakodowaną czcionkę (base64)
    const font = "";

    const callAddFont = function () {
        try {
            console.log("Rejestrowanie czcionki w VFS...");
            this.addFileToVFS("Roboto_Condensed-Regular-normal.ttf", font);
            console.log("Dodawanie czcionki Roboto_Condensed-Regular...");
            this.addFont("Roboto_Condensed-Regular-normal.ttf", "Roboto_Condensed-Regular", "normal");
            console.log("Czcionka Roboto Condensed dodana pomyślnie.");
        } catch (e) {
            console.error("Błąd podczas dodawania czcionki do jsPDF:", e);
        }
    };

    if (jsPDFAPI.events && typeof jsPDFAPI.events.push === 'function') {
        jsPDFAPI.events.push(['addFonts', function () {
            // wywołaj callAddFont z poprawnym kontekstem this
            callAddFont.call(this);
        }]);
        console.log("Funkcja rejestracji czcionki (callAddFont z call) dodana do zdarzeń jsPDF.");
        return true;
    }
 else {
        console.error("System zdarzeń jsPDF (jsPDFAPI.events) nie znaleziony. Nie można zarejestrować czcionki przez zdarzenie.");
        return false;
    }
}
